                    "text": "<p>Nachdem ich in den vergangenen Wochen Osaka und das japanische Festland erkundet hatte, versp&uuml;rte ich eine wachsende Sehnsucht nach Sonne und Meer.</p>\n<p>&nbsp;</p>\n<p>Daher entschied ich mich, nach Okinawa zu fliegen, um neue Energie zu tanken.</p>\n<p>&nbsp;</p>\n<p>W&auml;hrend des Flugs sa&szlig; Yasmina neben mir, eine Backpackerin aus Deutschland, die ebenfalls auf dem Weg nach Okinawa war.</p>\n<p>&nbsp;</p>\n<p>Da der Flug am fr&uuml;hen Morgen stattfand, hatten wir den ganzen Tag noch vor uns.</p>\n<p>&nbsp;</p>\n<p>Nachdem wir im Hostel eingecheckt hatten, beschlossen wir, an den Strand zu gehen und den Tag dort entspannt zu genie&szlig;en.</p>\n<p>&nbsp;</p>\n<p>Am Abend sa&szlig;en wir gemeinsam an einer Beachbar und tranken Cocktails.</p>\n<p>&nbsp;</p>\n<p>Dabei erz&auml;hlte Yasmina mir von ihren Pl&auml;nen f&uuml;r die kommenden Tage: Sie wollte tauchen gehen.</p>\n<p>&nbsp;</p>\n<p>Begeistert berichtete ich ihr, dass ich ebenfalls einen Tauchschein habe, und so beschlossen wir, zusammen tauchen zu gehen.</p>\n<p>&nbsp;</p>\n<p>Am n&auml;chsten Tag nahmen wir die F&auml;hre zu den Zamami-Inseln, die von Naha, der Hauptstadt Okinawas, aus gut erreichbar sind, um dort gemeinsam die faszinierende Unterwasserwelt zu erkunden.</p>",
